export default Icon;

export interface IconInfoProps {
  name: AvailableIcons;
  value: string;
  className?: string;
  iconSize?: number;
  small?: boolean;
}

export const IconInfo: component.base.View<IconInfoProps> = ({
  name,
  value,
  className,
  iconSize,
  small
}) => {
  iconSize =
    iconSize || (small ? DEFAULT_ICON_WIDTH - 0.1 : DEFAULT_ICON_WIDTH);
  return (
    <div className={className}>
      <div
        className={`d-flex flex-nowrap align-items-center text-nowrap ${
          small ? "font-size-small" : ""
        }`}>
        <Icon
          name={name}
          width={iconSize}
          height={iconSize}
          className="me-2 flex-shrink-0"
        />
        {value}
      </div>
    </div>
  );
};
